def run_blackjack_training(env, total_games, learning_rate=0.1, discount=1.0, exploration=0.1):
    value_table = defaultdict(lambda: np.zeros(env.action_space.n))

    for episode_num in range(total_games):
        current_state = initialize_env(env)
        finished = False

        while not finished:
            if np.random.rand() < exploration:
                chosen_action = env.action_space.sample()
            else:
                max_actions = np.argmax(value_table[current_state])
                chosen_action = max_actions

            new_state, gained_reward, finished, _ = unified_step(env, chosen_action)

            if not finished:
                future_reward = np.max(value_table[new_state])
            else:
                future_reward = 0

            if current_state in value_table:
                previous_value = value_table[current_state][chosen_action]
                correction = learning_rate * (gained_reward + discount * future_reward - previous_value)
                value_table[current_state][chosen_action] += correction
            else:
                value_table[current_state][chosen_action] = gained_reward

            current_state = new_state

    final_policy = {}
    for state, actions in value_table.items():
        if actions.any():
            final_policy[state] = np.argmax(actions)
        else:
            final_policy[state] = env.action_space.sample()

    return value_table, final_policy

def initialize_env(env_instance):
    outcome = env_instance.reset()
    return outcome[0] if isinstance(outcome, tuple) else outcome

def unified_step(env_instance, action_choice):
    outcome = env_instance.step(action_choice)
    if len(outcome) == 5:
        obs, reward, terminated, truncated, info = outcome
        end = bool(terminated) or bool(truncated)  # Safely cast to Python bool
    else:
        obs, reward, end, info = outcome
        end = bool(end)  # Just in case
    return obs, reward, end, info


def assess_policy_performance(env_instance, strategy, simulations=10000):
    victories = 0
    for _ in range(simulations):
        condition = False
        state = initialize_env(env_instance)

        while not condition:
            if state in strategy:
                action_to_take = strategy[state]
            else:
                action_to_take = env_instance.action_space.sample()

            state, reward, condition, _ = unified_step(env_instance, action_to_take)

            if reward > 0:
                victories += 1
    return victories / simulations
